import './Expense.css'
import ExpenseItem from './ExpenseItem'
const Expense = (props) => {

    return (
        <div className="expenses">
            <ExpenseItem title={props.items[0].title} amount={props.items[0].amount} date={props.items[0].amount} />
            <ExpenseItem title={props.items[1].title} amount={props.items[1].amount} date={props.items[1].amount} />
            <ExpenseItem title={props.items[2].title} amount={props.items[0].amount} date={props.items[2].amount} />
            <ExpenseItem title={props.items[0].title} amount={props.items[0].amount} date={props.items[0].amount} />
        </div>
    )


}

export default Expense
